INSERT INTO `community` (`communityID`, `title`, `description`, `visibility`, `association`, `kind`, `subcategoryID`, `categoryID`, `status`, `userID`, `tools`) VALUES ('1015439199628', 'Introdução a Informática', 'Esta disciplina visa fornecer aos alunos dois tipos de competência: (i) Fornecer uma visão geral de um sistema computacional numa visão integrada de seus componentes de hardware e software. Dar (ii) uma visão geral dos principais temas da computação, procurando situar o aluno nas principais disciplinas do curso.  ', '2', '0', 'D', '1', '1', 'A', '1015438291312', 31),
('1015618391913', 'Comércio Eletronico', 'Curso de Comércio Eletronico em nível de Pós Graduação.', '4', '0', 'E', '1', '1', 'A', '1015438291312', 31),
('1016044335989', 'Inteligência Artificial I', 'Trata-se de um primeiro curso de IA abrangendo os tópicos sobre Resolução de Problema/Busca, jogos, Aquisição e Representação de Conhecimento e Sistemas Especialistas: Conceitos, Tecnologias e Aplicações. ', '2', '0', 'D', '1', '1', 'A', '1015438291312', 31),
('1017949971802', 'BioInfoAL', 'Grupo formado por pesquisadores interessados em discutir os rumos da Bioinformática em Alagoas.', '4', '1', 'G', '1', '1', 'A', '1015347803599', 31),
('1018034927150', 'English lovers', 'We are a special group interested in English literature. At the moment we are studying William Shakespeare works. So, you are invited to join us any time.   ', '4', '1', 'G', '80', '10', 'A', '1015438291312', 31),
('1017690605883', 'Gestao do Conhecimento', 'Trata-se de um curso que é parte integrante do elenco de disciplinas do Curso de Especialização em Tecnologia da Informação do TCI/UFAL. ', '4', '1', 'E', '1', '1', 'A', '1015438291312', 31),
('1016045744316', 'Inteligência Artificial II', 'Essa disciplina é uma continuação natural de IA1, envolvendo tópicos sobre Inteligência Artificial Distribuída em suas diversas abordagens, com aplicações em vários domínios de conhecimento.', '2', '0', 'D', '1', '1', 'A', '1015438291312', 31),
('1018630040414', 'Projetando um Data Warehouse', 'Disciplina do Curso de TI<br>Ministrada por Marcus Costa Sampaio.', '4', '0', 'E', '1', '1', 'A', '1018372172359', 31),
('1019503684356', 'Programação 1', 'Aprendizagem de lógica de programação', '2', '0', 'D', '1', '1', 'A', '1019503247967', 31),
('1019521412057', 'Programação', 'Discussão sobre as linguagens de programação.', '1', '0', 'E', '1', '1', 'A', '1018517966065', 31),
('1019742207241', 'Redes e Internet', 'Grupo para debates de tecnológias de redes e da Internet.', '4', '0', 'G', '1', '1', 'A', '1019139944399', 31),
('1019795057341', 'LINUX', 'Este grupo seria basicamente para discutir a respeito de configuracoes e caracteristicas do mesmo!', '4', '0', 'G', '1', '1', 'A', '1019524452416', 31),
('1019939868602', 'AutoEducação Vitalícia', 'Aguarde...', '4', '0', 'G', '12', '5', 'A', '1019534419119', 31),
('1021497581156', 'Seminários de Tecnologia da Informação', 'Seminários do departamento de Tecnologia da Informação da UFAL.', '4', '0', 'E', '1', '1', 'A', '1015438291312', 31),
('1023427471602', 'Computação Gráfica', 'Computação gráfica - conceitos, paradigmas de abstração, dispositivos gráficos; Sistemas de cor; Imagem digital; Transformações geométricas; A modelagem geométrica; Visualização em 3D; \'Rendering\'; Elementos sobre animação; Introdução à Realidade Virtual - a linguagem VRML.', '2', '0', 'D', '1', '1', 'A', '1019484142388', 31),
('1024592802696', 'Formandos 2002', 'Grupo de discussão sobre os pontos importantes da formatura de Ciências da Computação 2002. p.e: escolhas de locais, reuniões importantes, descritivo de receitas, ...', '4', '1', 'G', '1', '1', 'A', '1015439644996', 31),
('1024947765737', 'Laboratório de Programação I', 'Aulas práticas de Programação I', '2', '0', 'D', '1', '1', 'A', '1024938674289', 31),
('1024972883359', 'música', 'grupo de debate da galera que se interessa por música em geral!', '4', '0', 'G', '78', '10', 'A', '1024972245024', 31),
('1025028206102', 'Programação I - turma B', 'Resolução de problemas: algoritmos. Estudo de uma linguagem de programação estruturada: conceito de variável, estrutura de uma programa, comandos básicos, estruturas de decisão e de repetição,  procedimentos e funções, tipos estruturados, recursividade, ponteiros.', '2', '0', 'D', '1', '1', 'A', '1019484142388', 31),
('1025280704476', 'Teoria da Computação', 'Metodologia: Aula expositiva, seminários e debates, pesquisas temáticas, uso de laboratório, etc.', '2', '0', 'D', '1', '1', 'A', '1018466256322', 31),
('1025704105442', 'Análise de Sistemas I', '...', '2', '0', 'D', '1', '1', 'A', '1025779965235', 31),
('1026141445052', 'Análise de Sistemas 2', 'a colocar', '2', '0', 'D', '1', '1', 'A', '1019511473814', 31),
('1026427482871', 'Empreendedorismo em Informática', 'A disciplina apresenta sob a forma de palestras e depoimentos de empreendedores, conceitos básicos de administração e criação de empresas. Objetiva inocular o vírus do empreendedorismo nos alunos da Computação.', '2', '0', 'D', '1', '1', 'A', '1025779965235', 31),
('1026806480296', 'Telecomunicações - Tecnologias e Aplicações', 'O curso abordará os aspectos conceituais sobre a tecnologia de telecomunicações , suas aplicações e o impacto na sociedade.', '4', '0', 'E', '1', '1', 'A', '1021497701327', 31),
('1026932502854', 'Desenvolvimento', 'Grupo que abordaria todos os aspectos, dúvidas e interesses<br>relacionados a desenvolvimento. ', '4', '0', 'G', '1', '1', 'A', '1026149751572', 31),
