INSERT INTO `course` (`communityID`, `program`, `hours`, `bibliography`) VALUES ('1015439199628', 'Será preenchido depois.', 80, 'Tan'),
('1015618391913', 'E-Commerce. E-Business.', 30, 'XX'),
('1016044335989', '1. Resolução de Problemas/Busca.<br>2. Aquisição e Representação de Conhecimento<br>3. Sistemas Especialistas: Conceitos, Tecnologias e Aplicações. <br>Obs.: Em breve será descrito todo o Plano de Curso', 80, 'Stuart Russell & Peter Norvig. Artificial Intelligence: A Modern Approach.\r\nElaine Rich & Kervin Knight. Inteligência Artificial. Makron books.<br>Guilherme Bittencourt. Inteligência Artificial.'),
('1017690605883', 'O curso consta de duas partes: Uma voltada para discutir o conhecimento que é trabalho dentro de uma organização/empresa, analisando os processos de aquisição, armazenamento e transmissão do conhecimento. Na segunda parte, discutem-se as tecnologias que dão suporte à gestão do conhecimento.', 32, 'A ser definida'),
('1018630040414', '1-Apresentar os conceitos e terminologia de sistemas de Data Warehousing<br>2-Discutir como projetar um Data Warehouse (DW)<br>3-Discutir como implementar um DW<br>4-Sedimentar os conhecimentos adquiridos por meio de um projeto de DW', 16, 'The Data Warehouse Lifecycle Toolkit, Ralph Kimball et al, John Wiley & Sons, 1998. <br>The Data Warehouse Toolkit, Ralph Kimball, John Wiley & Sons, 1996. Obs: Existe tradução para o Português. <br>Essential Oracle8i Data Warehousing, Gary Dodge & Tim Gorman, John Wiley & Sons, 2000. <br>Data Warehousing and Business Intelligence for E-Commerce, Alan R. Simon, Steven L. Shaffer, Morgan Kaufmann Publishers, 2001 <br>'),
('1016045744316', '1. Tópicos Avançados em Aquisição de Conhecimento;<br><br>2. Tópicos Avançados em Representação de Conhecimento;<br><br>3. IA Distribuída e suas principais abordagens. Resolução Distribuída de Problemas e Sistemas Multiagentes;<br> <br>4. Aplicações em diversos domínios: <br>    <br>4.1. Segurança de Redes de Telecomunicações/Computadores;     <br><br>4.2. Comércio Eletrônico;<br><br>4.3. Jogos; <br><br>4.4. Recuperação de Informação.', 80, 'Russell & Norvig. Artificial Intelligence: A Modern Approach.<BR> <img src=http://www.cs.berkeley.edu/~russell/aima-cover.gif>'),
