('1023427471602', 'Parte I - Bases da CG<br>1 - Introdução<br>1.1 - Conceito <br>1.2 - Paradigmas de abstração<br>1.3 - Aplicações da CG<br>2 - Cor<br>2.1 - Espaços de cor<br>2.2 - Sólido de cor<br>2.3 - Sistemas de cor<br>3 - Dispositivos gráficos <br>3.1 - Formato dos dados gráficos<br>3.2 - Classificação dos dispositivos<br>3.2 - Monitores de vídeo<br>4 - Imagem<br>4.1 - Imagem contínua e imagem digital, <br>4.2 - Quantização e Codificação<br>5 - Aspectos geométricos da computação gráfica<br>5.1 - Fundamentos sobre vetores e coordenadas<br>5.2 - Coordenadas homogêneas<br>5.3 - Transformações geométricas<br>6 - Modelagem geométrica<br>6.1 - Representação de objetos <br>6.2 - Representação poligonal<br>7 - Visualização<br>7.1 - A câmara virtual e o suporte de exibição<br>7.2 - Transformações geométricas de visualização<br>7.3 - Mapeamento para o viewport<br>8 - Rendering<br>Parte II - Realidade Virtual (RV) e a linguagem VRML<br>1 - Introdução<br>1.1 - Sistemas com interfaces não convencionais<br>1.2 - Breve histórico sobre a RV<br>1.3 - Aplicações de Realidade Virtual<br>2 - Geração de mundos virtuais<br>2.1. Modelagem<br>2.2. Programação e plataformas para aplicação de RV<br>3 - A linguagem VRML<br>4 - A construção dos objetos em VRML<br>4.1 - O nó Shape<br>4.2 - Agrupamento e transformações<br>5 - Animação em VRML<br>6 - Interação com o mundo virtual em VRML <br>4.1 - Sensores de toque; <br>4.2 - Sensores de proximidade<br>7 - Mapeamento de texturas.<br>8 - Iluminação: luz pontual, luz direcional, spot. <br>9 - Backgrounds<br>10 - Montagem de mundos virtuais a partir de arquivos preexistentes<br>11 - Âncoras<br>12 - Controle do ponto de vista<br>', 80, '1 - Computação Gráfica, Vol. 1, J. M. Gomes e L. C. Velho, IMPA, Rio de Janeiro, 1998.<br>2 - Computação Gráfica: Imagem, J. M. Gomes e L. C. Velho, IMPA/SBM, Rio de Janeiro, 1994.<br>3 - Vrml 2.0 Sourcebook, 2a ed. - A.L. Ames, D.R. Nadeau e J.L. Moreland, John Wiley, New York, 1997<br>BIBLIOGRAFIA COMPLEMENTAR: