('1026410117292', '1019742207241', 'vDHCP 0.10', 'vdhcp010.zip', '294103', 'Esse é um ótimo programa para quem deseja compartilhar sua conexão com outros computadores em rede, basta instalar esse programa no servidor, junto com o ICS (Internet Conection Sharing).', '1026409984574'),
