('1029362123173', '1029320981135', 'UML e o Processo Iterativo da Rational', 'uml.zip', '112705', '   Como eu disse na última aula, não é objetivo do curso mostrar uma metodologia ou processo de desenvolvimento de software. UML é apenas uma notação utilizada e terá pouco enfoque no contexto desta disciplina.<br>    Este documento é uma apresentação feita pela Rational (empresa detentora dos direitos da UML) sobre UML e o processo iterativo da Rational.<br>    Proponho que todos leiam este documento, à medida que o assunto UML for encaminhado.<br>    Discutirei com a professora Eliana a possibilidade de uma equipe ou duas, apresentarem seminários sobre estes assuntos em horários a serem definidos. Sendo assim, estes alunos, liberados de 1 dos mini-testes que estarão por vir.<br>    Qualquer dúvida, ou sugestão, enviem-me um e-mail.', '1029361031715'),
