INSERT INTO `grouping` (`groupingID`, `goal`, `courseID`) VALUES ('1017949971802', 'Estudo sobre:\r\n*Algoritmos Genéticos;\r\n*Biologia Computacional;\r\n*Data Mining em sequências de DNA.', NULL),
('1018034927150', 'Our main goal is to be proficient in English literature.', NULL),
('1019742207241', 'Uma forma rápida e versátil de troca de informações e desnvolvimento de novas tecnológias na area.', NULL),
('1019795057341', 'Capacitar os alunos e interessados em aprimorar seus conhecimentos nesta plataforma, a qual vejo que sera o futuro das corporacoes!', NULL),
('1019939868602', 'Aguarde...', NULL),
('1024592802696', 'o mesmo que descrição', NULL),
('1024972883359', 'promover a interação entre os tocadores! discutir sobre ritmos, tecnologias, instrumentos, bandas....', NULL),
('1026932502854', 'Manifestar o interesse e dúvidas sobre programação, web design, servidores web, so, redes, etc..\r\nMas sempre se voltando ao desenvolvimento de sistemas e/ou outro tipo de abordagem.', NULL),
('1027197159583', 'MANTER ATUALIZADOS, OS ALUNOS DA DISCIPLINA, COM O DESENVOLVIMENTO DA MESMA', NULL),
('1027220991149', 'Acompanhar o treinamento dos possíveis participantes', NULL),
('1027970948483', 'Haver uma troca de idéias sobre design na web, bem como as resoluções sobre dúvidas que vierem a surgir no desenvolvimento de uma aplicação que envolva as ferramentas e as linguagens para a produção de sites na internet.', NULL),
('1029445174429', 'Estudar e revisar todos os principais conceitos da bibliografia do teste, além de prover material atualizados sobre os temas.\r\n\r\n*** Fundamentos de Computação ***\r\n- Arquitetura de Computadores; \r\n- Circuitos Digitais; \r\n- Estrutura de Dados; \r\n- Linguagem Formais, Autômatos e Computabilidade; \r\n- Linguagens de Programação; \r\n- Projeto e Análise de Algoritmos; \r\n- Pesquisa e Ordenação; \r\n- Sistemas Operacionais; \r\n- Técnicas de Programação; \r\n- Teoria dos Grafos. \r\n\r\n*** Tecnologia da Computação ***\r\n- Banco de Dados; \r\n- Compiladores; \r\n- Computação Gráfica; \r\n- Engenharia de Software; \r\n- Inteligência Artificial;  \r\n- Processamento de Imagens; \r\n- Redes de Computadores; \r\n- Sistemas Distribuídos. ', NULL),
('1030115131831', 'Interagir mais os estudantes de computação da UFAL à assuntos relativos a nossa executiva nacional', NULL);
