INSERT INTO `link` (`linkID`, `communityID`, `title`, `address`, `description`, `categoryID`) VALUES ('1017770481137', '1016044335989', 'Expert Sinta', 'http://www.lia.ufc.br/~bezerra/', 'Ferramenta de desenvolvimento de sistemas especialista desenvolvido por pesquisadores do Laboratório de Inteligência Artificial da Universidade Federal do Ceará.', '1017770356770'),
('1017770829874', '1016044335989', 'XVI Brazilian Symposium On Artificial Intelligence', 'http://www.cin.ufpe.br/~sbiarn02/', 'Trata-se de uma conferência de porte internacional (basta o comitê de programa que é formado por prestigiados pesquisadores de várias partes do mundo. Dessa vez esse evento ocorrerá bem pertinho da gente, ou seja, em Recife-PE. Então, temos uma oportunidade ímpar para vários pesquisadores de renome, tanto nacional quanto estrangeiro.', '1017770537488'),
('1017826169242', '1016044335989', 'Databases and Artificial Intelligence', 'http://www.cee.hw.ac.uk/~alison/ai3notes/all.html', 'É um grande resumo de tudo que é visto na disciplina, além de informações adicionais. Segue abaixo a lista de assuntos vistos em sala.<br><br>* Introduction;<br>* Knowledge Representation and Inference;<br>* Using Search in Problem Solving;<br>* Expert Systems;', '1017825799585'),
('1017826814269', '1016044335989', 'AI on the Web', 'http://www.cs.berkeley.edu/~russell/ai.html', 'Relação de 854 links sobre Inteligência Artificial, desde revistas especializadas, grupos de pesquisa, softwares diversos... Uma coleção pessoal do pesquisador Stuart Russel, autor do livro Artificial Intelligence: A Modern Approach. ', '1017826613995'),
('1017931649266', '1015618391913', 'Aspectos de Segurança em Comércio Eletrônico', 'http://www.ufal.br/~heitor/seguranca', 'Palestra sobre segurança em comércio eletrônico<br>Nível - Introdutório', '1017931586279'),
('1017931753993', '1015618391913', 'Aspectos de Segurança em Comércio Eletrônico II', 'http://www.ufal.br/~heitor/seguranca/web.zip', 'Versão para download da palestra sobre segurança em comércio eletrônico', '1017931586279'),
('1019679131254', '1018630040414', 'URL', 'http://www.dsc.ufpb.br/~sampaio/', 'URL', '1019679086951'),
