('1019746113226', '1019742207241', 'Tutoriais (Lemon)', 'http://www.lemon.com.br/canais/tutoriais/internetredes.cfm', 'Página com vários tutoriais sobre aplicativos de rede e internet.', '1019746014215'),
('1019746697817', '1019742207241', 'Pos - Graduação', 'http://www.ibpi.com.br/asis/as_curso.html', 'Curso de pos-graduação em Segurança de Informações na Internet. Pela ASIS (Advanced School of Internet Security).', '1019746342396'),
('1019746899993', '1019742207241', 'Downloads (Site - Copie já)', 'http://www.copieja.com/categoria.asp?categoria=127', 'Site bem completo. Com vários aplicativos para diversas áreas de rede e internet.', '1019746775672'),
('1019748929860', '1019742207241', 'Um pouco sobre redes...', 'http://www.webpuc.hpg.ig.com.br/index.html', 'Site legal, que mostra o básico sobre redes...', '1019746014215'),
('1019781750251', '1019521412057', 'AmbySoft', 'http://www.ambysoft.com/', 'Site muito interessante para desenvolvedores', '1019730282074'),
('1019842226237', '1019521412057', 'Portal C', 'http://www.portalc.nip.net', 'Bom site de referência para C, tem compiladores, códigos fontes de vários programas, entre outras coisas.', '1019842155120'),
('1019926286446', '1017690605883', 'Gestão do Conhecimento', 'http://www.informal.com.br/', 'Nesta página pode-se encontrar boas entrevistas, uma faq com questões interessantes.', '1019926154496'),
('1020389305490', '1019521412057', '\'The C Programming Language\', 2nd edition', 'http://users.powernet.co.uk/eton/kandr2/', '\'The C Programming Language\', 2nd edition,<br>Kernighan and Ritchie<br>Answers to Exercises<br>Maintained by Richard Heathfield<br>', '1019842155120'),
('1020389528505', '1019521412057', 'http://www.dsc.ufpb.br/~jacques/', 'http://www.dsc.ufpb.br/~jacques/', 'Comentário do Rodrigo Mosca: \'Aqui está uma das melhores páginas de professores que eu já vi... lá tem vários cursos ministrados principalmente no mestrado da UFPB... tem um muito legal de Design Pattern... realmente vale a pena colocar esse link.\'', '1020389449332'),
('1020806627732', '1016045744316', 'IDS Baseados em Sistemas Multiagentes', 'http://www.ufal.br/~ids/index_arquivos/frame.htm', 'Equipe:<br>Alan Walber<br>Eunice Palmeira<br>Marcelio Malta<br>Marcelo Queiroz<br>Marcílio Júnior ', '1020806576321'),
('1022420106435', '1018034927150', 'efr2', 'http://br.groups.yahoo.com/group/efr2/', 'This is a list for developing the reading ability <br>of the English language for speakers of Portuguese. Every day a humorours message or quote is sent to its subscribers. The most difficult words are commented with their translations into portuguese', '1022420056192'),
('1022420359149', '1018034927150', 'Verbos Irregulares da Língua Inglesa', 'http://www.idph.net/idiomas/verbosirregulares.shtml', 'Tabela contendo a lista dos verbos irregulares da língua inglesa e suas traduções.', '1022420328970'),
('1023398979488', '1018034927150', 'English Made in Brazil', 'http://www.sk.com.br/sk.html', 'A great site with list of vocabularies, pronunciation tips, Word-Formation, Word Histories Gramma and others...', '1022420328970'),
('1023408467125', '1018034927150', 'Novo ingles', 'http://www.ingles.com.br', 'Novo site sobre ingles.<br>p.s.: apenas teste.', '1022420328970'),
('1024427876709', '1018034927150', 'English-Zone.com', 'http://www.english-zone.com', 'The best place to begin studying and remember our classes... It contains many tips and online tests... Perfect for us!', '1022420328970'),
('1025213663581', '1016044335989', 'A.I. - O Filme', 'http://www.cin.ufpe.br/~apm/ia1/links/super.html', 'Reportagem da revista Super Interessante sobre o filme A.I. (Inteligência Artificial).', '1025212982938'),
('1026231214841', '1016044335989', 'Tecnologia cria dublê de voz', 'http://www.cnn.com.br/2002/tec/07/03/voz/index.html', 'Pesquisadores do Instituto de Tecnologia de Massachusetts (MIT) combinaram inteligência artificial e videografia... é ler e conferir!', '1026230939305'),
('1025635726514', '1016044335989', 'Laboratório de Visão Cognitiva de Harvard', 'http://www.wjh.harvard.edu/~viscog/lab/', 'Link para o laboratório que estuda visão cognitiva em Harvard. Os principais pontos de pesquisa são:<br>-Detecção de mudanças;<br>-Cegueira intencional;<br>-Atualização espacial;<br>-Teorias indutivas.<br>Os vídeos estão no link \'Demonstrations\':<br>http://www.wjh.harvard.edu/~viscog/lab/demos.html', '1025212982938'),
('1026925155554', '1023427471602', '\'All About Digital Images\'', 'http://mentor.coe.uwf.edu/eme6415/digital_image/index.htm', 'Dá uma visão bastante prática sobre imagens digitais: captura, resolução, compressão, formatos de arquivos, etc.', '1026925052958'),
