('1029358467662', '1029320981135', 'Java Code Conventions - Convenções de código Java', 'http://java.sun.com/docs/codeconv/', '   Convenções padronizadas de programação na  linguagem Java, utilizadas pelos programadores da Sun Microsystems. Está disponível para download e on-line. <br>   ', '1029358190259'),
('1029359258400', '1029320981135', 'UML - Tutorial', 'http://www.iis.com.br/~coriceu/prodsoft/apresuml/', '  Descrição dos principais conceitos e diagramas em relação à UML. Apresentação on-line. <br>  Já que o objetivo do curso não é aprofundar o conhecimento em UML, não custa nada dar uma olhada neste documento. :)', '1029358038708'),
('1029359656241', '1029320981135', 'Jacques Sauvé - HP', 'http://www.dsc.ufpb.br/~jacques/cursos/2002.1/poo/', '  Os padrões da Gangue dos 4 (Gang of Four) serão apresentados, nesta disciplina, baseando-se neste link. Ainda não defini os padrões que serão abordados em sala. Na dúvida, leia todos! ', '1029358233861');
INSERT INTO `message` (`messageID`, `ownerMessageID`, `title`, `userID`, `description`, `communityID`, `categoryID`) VALUES ('1017691466037', '', 'Gestão do Conhecimento: Quando investir?', '1015438291312', 'Este fórum visa uma discussão no tema Gestão do Conhecimento, tentando responder à pergunta: vale a pena investir? Como investir? Quanto custa?', '1017690605883', '1017691290653'),
('1018322558739', '1017691466037', 'Resp: Gestão do Conhecimento: Quando investir?', '1017800925273', 'No meu entender a resposta a esta pergunta seria \'já\', porem percebo que depende muito da estrutura existente na empresa interessada no processo de gestao, assim como do despertar dos administradores para este novo conceito.', '1017690605883', '1017691290653'),
('1019493097773', '', 'O que significa?', '1019139944399', 'Eu já ouvi falar bastante sobre Data Warehouse... só que eu não sei bem o que é e como funciona.<br>Seria possível alguem me esplicar ?', '1018630040414', '1019492658745'),
('1019521792714', '', 'Placas Mãe e perfomance', '1018517966065', 'ALguém poderia dá um breve histórico da evolução das placas mãe, ou indicar algum site onde se possa tomar nota disso.', '1015439199628', '1019521673978'),
('1019522357098', '', 'C++ e Computação Gráfica', '1018517966065', 'Onde posso encontrar referências na internet ou bibliográficas sobre bibliotecas gráficas para C++?', '1019503684356', '1019522197038'),
('1019537293428', '1019522357098', 'Resp: C++ e Computação Gráfica', '1019234882319', 'Já olhou em http://www.tol.pro.br ?????  <br>Ví uns tutoriais e umas coisas por lá...', '1019503684356', '1019522197038'),
('1019754993274', '1019521792714', 'Resp: Placas Mãe e perfomance', '1015331789194', 'Nao entendo muito de hardware.. mas sei de um site excelente sobre esse assunto com muitos aspectos técnicos e práticos... ai vai:<br>http://www.clubedohardware.com.br<br>', '1015439199628', '1019521673978'),
('1019755485998', '1019522357098', 'Resp: C++ e Computação Gráfica', '1015331789194', 'Um biblioteca gráfica excelente é o QT que tem algumas versões free tanto pra linux quanto pra windows...<br>Aqui vai o endereço:<br>http://www.trolltech.com/products/qt/index.html<br><br>Outra tbm muito boa é o gtk que foi usada pelo GIMP, tambem existem varios builders para ela , mais informaoes em:<br>http://www.gtk.org/<br>', '1019503684356', '1019522197038'),
('1019840729040', '', 'API', '1018517966065', 'Tava estudando as bibliotecas gráficas do C quando me deparei com a frase \'Essas bibliotecas não funcionam no Windows, pois este últimos já tem um pacote de funções gráficas que são parte da API...\' O que é API? qual sua utilidade? Como uso? e como acho???', '1019503684356', '1019522197038'),
('1019840805938', '', 'API', '1018517966065', 'Tava estudando as bibliotecas gráficas do C quando me deparei com a frase \'Essas bibliotecas não funcionam no Windows, pois este últimos já tem um pacote de funções gráficas que são parte da API...\' O que é API? qual sua utilidade? Como uso? e como acho???', '1019521412057', '1019840790435'),
('1019849273995', '1019840805938', 'Resp: API', '1015331789194', 'Pra inicio ... API siginifica Aplication Program Interface, ou seja, simplificando nada mais eh do que um conjunto de bibliotecas, sejam elas gráficas ou nao, que você pode usar no seu programa. Por exemplo... quando vc programa em c e usa algumas bibliotecas como a conio , a stdlib e etc... elas disponibilizam uma interface (ou seja.. uma maneira de voce usa-las, explicando quais sao seus metodos, parametros, retornos , etc...) você já está usando uma api. O windows já disponibiliza uma API (que ele tbm usa) para se voce quiser fazer seus programas graficos poder usa-la. Porem eu nao recomendo que vc use essa api, pois eu particularmente acho muito confusa. Alias nao recomendo nem que voce faca nada grafico em C... (talvez seja melhor C++). Mas se vc quer fazer algo grafico em C ... eu recomendo que vc use o GTK.', '1019521412057', '1019840790435'),
('1019926794486', '', 'Gestão do Conhecimento e Competitividade', '1015438291312', 'Você acha que uma empresa pode sobreviver no mercado globalalizado sem investir em Gestão de Conhecimento?', '1017690605883', '1017691290653'),
('1019929890755', '', 'Vírus', '1015438291312', 'O que há de comum entre um vírus biológico e um vírus de computador? (Sugestão: leiam artigos de John von Newmann - década de 40)', '1015439199628', '1019929104096'),
('1019996779324', '1019493097773', 'Resp: O que significa?', '1015331789194', 'Julio,<br> Vc pode obter muitas informações sobre DW em : http://www.dwinfocenter.org/ . Mas posso adiantar, com uma visão bastante simplificada o seguinte: DW é como se vc pegasse a informações de várias fontes de dados ( na maioria delas da parte operacional da sua empresa ), e unisse elas seguindo algumas restrições, para que essas informações possam a ser úteis na tomada de decisão por parte da gerência da empresa. :)', '1018630040414', '1019492658745'),
('1020020407259', '1019929890755', 'Resp: Vírus', '1018619379980', 'Vírus:<br> - Alteram o funcionamento normal do computador /<br>   organismo;<br> - Auto-reproduzem-se sem a intervenção direta do<br>   usuário / organismo;<br> - Atuam imediatamente a contaminação do organis<br>   mo / computador ou aguardam a melhor ocasião<br>   para tal<br> - Quanto mais atual, mais destrutivo;<br> - Mutantes, dificultando a localização e destrui-<br>   ção pelos antivírus / anticorpos.<br><br> Uma boa referência: <br> - http://www.seguraweb.com/virus.htm', '1015439199628', '1019929104096'),
('1029881081519', '1029360424460', 'Resp: Onde fica o limite entre usar ou não a engenharia de software?', '1018369114777', 'Talvez não seja necessária uma modelagem minuciosa, dependendo do problema. Mas uma documentação mínima é necessária. Até para demonstrar o que motivou aquela ferramenta e qual foi o raciocínio básico.', '1029320981135', '1029360153116'),
('1029621028357', '1029360089931', 'Resp: Resp: Por que programar seguindo um padrão de codificação?', '1015439644996', 'Os padrões surgem realmente para que qualquer \'leitor de código\' possa entender o que realmente o que tem ali, tipo, todos devem \'falar a mesma lingua\'... Desde que esse leitor \'já tenha sido educado\' para entender \'aquele lição\'... <br><br>Respondendo a: <br>Resp: Por que programar seguindo um padrão de codificação?', '1029320981135', '1029359733161'),
('1029534812901', '1029360089931', 'Resp: Por que programar seguindo um padrão de codificação?', '1017770043725', 'Seguir um padrão de codificação hoje é extremamente indispensável, isso levando em conta manutenção, legibilidade e outros aspectos. Porque como o Alex mesmo citou, facilitaria muito o trabalho em grupo de programadores com estilos diferentes. Outro agravante que deve ser levado em conta são os usuários de forum tipo JAVA, ASP, PHP, etc, estes na sua grande maioria não possuem um padrão em sua programação, dificultando assim que outros programadores possam resolver suas duvidas e também por este motivo é importante manter-se um padrão de codificação  ', '1029320981135', '1029359733161'),
('1029521092074', '1029360424460', 'Resp: Onde fica o limite entre usar ou não a engenharia de software?', '1017230367133', 'Na minha opinião, não as metodologias de software como um todo, mas apenas a fase de análise do modelo tradicional de desenvolvimento O.O. é um bocado complicada. Vejamos, deve-se usar de forma maciça a UML ou outros diagramas para modelar algo que nem está feito, só ideias, e elas mudam muito.  Geralmente a compreensão \'real\' do problema só vem qdo. vc. o lê pela segunda ou terceira vez, a primeira solução nunca é a melhor.<br>Creio que seja uma das causas de tanto problema com a eng. de software. <br>Não que eu não goste UML, mas os diagramas que tentam representar o comportamento dinâmico do sistema atrapalham um bocado, e qdo. o vc. tem que alterar os fontes lá vai de volta alterar os diagramas e é aí que está o entrave. Uma análise e documentação leve serviria bem tanto para sistemas pequenos como grandes.<br><br>Pra construir o circuito elétrico/eletrônico usamos coisas físicas e bem definidas, e na parte de desenvolvimento de software não temos isto ainda, portanto creio que não deviamos levar tão a sério a forma de análise e modelagem de outras áreas.<br><br>Ainda em tempo, eu acho que Extreme Programming (www.extremeprogramming.org) chega mais perto da metodologia ideal!!!<br>', '1029320981135', '1029360153116'),
('1029520949050', '1027967652080', 'Resp: Estreiando', '1018369114777', 'Olá Gustavo,<br><br>Bom, Já trabalhei com ambos de forma isolada.<br>Para fazer a integração de ambos vc deve utilizar-se de um driver ODBC, que acredito que venha no próprio CD do Oracle, caso não venha vc pode conseguir no site do desenvolvedor. Esta desta forma vc pode trabalhar com os componentes do próprio DELPHI, o problema é que fica lento a medida que sua base toma proporções maiores. <br>Neste caso o interessante é utilizar componentes DELPHI específicos para manipulação de DB Oracle. Aí surge outro problema, normalmente essas soluções de bancos de dados pagas, possuem componentes de manipulação pagos.<br>Espero ter ajudado, qualquer coisa entre em contato, posso dar uma olhada nisso com vc.', '1026932502854', '1027967475124'),
('1029520431846', '1029360089931', 'Resp: Por que programar seguindo um padrão de codificação?', '1018369114777', 'A padronização na codificação ajuda o entendimento do código por terceiros e até mesmo pelo próprio programador (um certo tempo depois). Além de ajudar na nomenclatura de métodos, propriedades, classes, ...<br>Outra ferramenta bastante interessante são os Padrões de Software, que como foi defendido pelo Hyggo, é muito difícil vc encontrar hj em dia um problema que nunca foi deparado por ninguem. Estes problemas já têm solução e com um embasamento em Engenharia de Software bastante atraente (normalmente). ', '1029320981135', '1029359733161'),
('1029518825512', '1029360089931', 'Resp: Por que programar seguindo um padrão de codificação?', '1017230367133', 'Bom, eu acho que adotando-se um padrão para se programar, o problema de que cada programador de uma equipe de desenvolvimento tenha um estilo diferente de programar se acaba. O código fica mais legível e organizado, bem como o programador com o tempo assimila o estilo e deixa de escrever código ora de um jeito, ora de outro.<br>Por exemplo, vi numa lista de programação uma mensagem de um cara(novato) perguntando se realmente deveriamos endentar um programa, e que ele não tinha se acostumado a isso. Daí presumi que nem todo mundo tem a mesma consciência na hora de programar e isso ajuda muito.', '1029320981135', '1029359733161'),
('1029360089931', '', 'Por que programar seguindo um padrão de codificação?', '1026669832520', '  Um dos links disponibilizados por mim é o da página da Sun Microsystems sobre as convenções de codificação para a linguagem Java. Nesta página, eles recomendam fortemente que os programadores utilizem estas convenções na implementação de seus programas.<br>  Mas por que mudar o meu estilo de programação, perdendo tempo em me adequar a uma convenção, se elas não melhoram o desempenho do código em termos da sua execução? <br>  ', '1029320981135', '1029359733161'),
('1029360424460', '', 'Onde fica o limite entre usar ou não a engenharia de software?', '1026669832520', '  A utilização da engenharia de software é cada vez mais um fator indispensável no desenvolvimento de software.<br>  Mas será que todos os sistemas necessitam da \'burocracia\' imposta pelas metodologias desta engenharia?<br>  Quando é que o problema é complexo o suficiente para necessitar de uma engenharia de software? Sempre?<br>  Em comparação a outras engenharias... será que um engenheiro elétrico, faria um projeto detalhado para iluminar uma casinha de bonecas???', '1029320981135', '1029360153116'),
('1028754527247', '', 'Local de realização', '1026149751572', 'Leiam o email..', '1026427482871', '1028754502738'),
('1028306031616', '1020387926088', 'Resp: Java e aplicações comerciais Stand Alone', '1024519872238', 'A grande questão de java neste tipo de aplicação ainda é o desempenho<br><br>Respondendo a: <br>Resp: Java e aplicações comerciais Stand Alone', '1019521412057', '1020387870333'),
('1028137620352', '1020387926088', 'Resp: Java e aplicações comerciais Stand Alone', '1017230367133', 'Rodrigo, creio que depende muito da capacidade das maquinas que vao rodar o software,porem li numa revista que o Java ja supera o Delphi nos EUA. Portanto, nao sei dizer se realmente isso influencia muito.<br>Geralmente o que o programador quer e um RAD(Rapid Application Development) e criar as aplicacoes facilmente, se a linguagem oferecer um ambiente deste tipo creio que nao ha problema', '1019521412057', '1020387870333'),
('1028136966716', '', 'Na baixa', '1026149751572', '   Alguem q tenha algum programa desenvolvido especialmente para a disciplina Estrutura de dados, por favor, queiram me repassar, pois facilitaria a minha vida neste disciplina..<br>   Falo..<br><br>   qq material, mandem para gustavoguri@bol.com.br', '1019521412057', '1020352978976'),
('1028136833643', '', 'Exemplos', '1026149751572', '  Atençao Joao Veloso e outros que utilizem Delphi, gostaria que se algum de voces tivessem aplicativos em Delphi, exemplos, etc..passassem os para mim...<br>  Vou começar num projeto de sistema voltado pra processos administrativos e qualquer tipo de exemplo que tivesse uma interface legal e uma organizaçao de janelas bem feita, pudesse ser repassado para o meu email: gustavoguri@bol.com.br<br>', '1019521412057', '1024593863514'),
('1027967652080', '', 'Estreiando', '1026149751572', '  Fico muito feliz por haverem pessoas \'instigadas\' nesse curso.<br>  Gostaria de saber se existem pessoas nesse grupo que ja desenvolveram algo em Delphi/Oracle.<br>  Ja li e tive a oportunidade de mexer com os dois. Gostaria de saber como interagir os dois, de uma maneira facil e rapida.<br>  T+', '1026932502854', '1027967475124'),
('1027850794668', '1027028367048', 'Resp: Leitura Dinâmica', '1025779965235', 'Ok, Pessoal!<br><br>A sugestão está registrada e aceita. Já estou procurando um instrutor para um curso rápido de leitura dinâmica.<br>Quando tiver um nome confirmado, avisarei a todos.<br>', '1026427482871', '1027028302121'),
('1020387926088', '', 'Java e aplicações comerciais Stand Alone', '1015331789194', 'O que vcs acham do desenvovimento de aplicações Stand Alone com JAVA ?', '1019521412057', '1020387870333'),
('1027028367048', '', 'Leitura Dinâmica', '1015331789194', 'Assistindo a aula, achei muito interesante a idéia da leitura dinâmica. Será que não seria possível a criação de um curso de leitura dinâmica dentro dessa disciplina ?', '1026427482871', '1027028302121'),
('1027226882442', '1027028367048', 'Leitura Dinâmica', '1025801616515', 'Também achei interessante a Leitura Dinâmica e gostaria que tivéssemos palestras sobre o tema.<br>', '1026427482871', '1027028302121'),
('1027538356008', '1026232027895', 'Resp: Que bicho é esse?', '1018369114777', 'IA é uma área bastante interessante de estudo, pois proporciona a resolução de problemas que antes não poderiam ser resolvidos por uma máquina.<br>Dizer que já descobrimos (principalmente nós alunos) tudo o que podemos fazer com IA seria muita pretenção, estamos tendo uma primeira visão desta área agora.<br>Acredito que IA é uma área que ainda tem muito a crescer.<br>Quanto a matéria da Super Interessante, achei bastante interessante por colocar em discussão um tema bastante discutido, que é a questão da máquina substituir o homem. E o mais interessante é que esta matéria já dá uma dica de como isto poderá ser alcançado. Tem um pouco de viagem, mas com um bocado de realidade.', '1016044335989', '1026231399030'),
('1026653342437', '1020387926088', 'Resp: Resp: Java e aplicações comerciais Stand Alone', '1015331789194', 'Caro nelson... aplicações StandAlone são aquelas aplicações que geralmente rodam somente em um cliente, por exemplo o Word é uma aplicação StandAlone , porém o graW não é , pois ele roda em um servidor. Então a minha pergunta seria, vc acha viável construir sistemas como por exemplo um controle de estoque usando Java Swing (Interface Gráfica para Java), ou será que linguagens convencionais como o Delphi ainda são imbatíveis nesse ponto?<br><br>Respondendo a: <br>Resp: Java e aplicações comerciais Stand Alone', '1019521412057', '1020387870333'),
('1026581987677', '1026319467160', 'Resp: Reunião com os formandos', '1018445108826', 'Concordo com a Ana no que se refere as definições feitas pela comissão onde não foi dada nenhuma opção de escolha aos formandos, apenas tomamos conhecimento do que já havia sido decidido, devendo assim existir uma maior interação entre comissão e formandos<br><br>Respondendo a: <br>Reunião com os formandos', '1024592802696', '1026319232417'),
('1026577973806', '1026319467160', 'Reunião com os formandos', '1024519872238', 'O que acontece é que a comissão precisa de um orçamento base pra chegar a um valor para formatura e em cima desse valor fechar com a empresa de eventos e começar a arrecadar dinheiro através das mensalidades, rifas, etc. Sendo assim a comissão analisou todas as opções tipo: locais dos eventos, se ia ter capa nas cadeiras, vela nas mesas, passadeira na igreja,... e depois de extensa discussão, levando em conta sempre a relação custo/beneficio, chegou ao orçamento que foi apresentado formalmente aos formandos no começo da última semana em sala de aula tanto pela manhã como pela tarde. <br><br>O orçamento é a proposta de formatura da comissão para os formandos. A partir do momento que a proposta é apresentada os formandos vão se manifestar, aprovando-a ou não. Quando eu escrevi que a comissão iria apresentar o orçamento para discussão e questionamento eu não fui claro o suficiente: A formatura só vai acontecer quando os formandos aprovarem o orçamento em votação (como maioria).<br><br>Coisas como cor da roupa dos formandos devem ser decididas no futuro no mesmo formato pois a questão financeira é decisiva agora. <br><br>É bom que esta discussão esteja acontecendo pra que fique definido o papel de todos na formatura. A metodologia da comissão é exatamente como o orçamento, uma proposta. Se os formandos não estão satisfeitos operar-se as mudanças que tiverem de ser feitas. O objetivo é realizar uma festa bonita e viavel financeiramente.<br><br>Respondendo a: <br>Resp: Resp: Reunião com os formandos', '1024592802696', '1026319232417'),
('1026508962194', '', 'E-mail da Ana sobre as Reuniões !!!', '1020369242464', 'Gostaria de dizer que o email que mandei para a lista do graw sobre uma reuniao com as alegações e nao elagações :))) que tinha escrito no email foi em virtude do que está acontecendo sobre as decisoes que estão sendo realizadas atualmente ou melhor a maneira que estão sendo realizadas.<br><br>Em primeiro lugar gostaria de parabenizar as pessoas que se pronunciaram para participar da organização da formatura, porém, se entendi bem pelo email do João, acho que a Ana está com toda razão e que devemos nos reunir num horario oportuno para ambas as turmas de formandos (manha e tarde), para analizarmos essa situação.<br><br>Bem, finalizando gostaria de dizer que uma comissao de formatura é feita para mostrar varias proposta para serem decididas por todos os formandos e não decidir para que haja questionamento.<br><br>Obs.: Mandei outro email p/ lista falando sobre isso, mas acho que houve algum problema.<br><br>Obrigada, Alcimeire.', '1024592802696', '1026319232417'),
('1026415456638', '1026319467160', 'Resp: Resp: Reunião com os formandos', '1019700068942', 'Joao<br>Primeiro obrigada por ter respondido a minha pergunta. Voce falou que a comissão é quem irá decidir as coisas como os locais de baile, colação etc. Tudo bem, eu acho que seria interessante que a comissão buscasse os locais e oferecesse  opções aos formandos e nao só comunicasse os locais já definidos. Quanto a roupa tambem sera a só a comissao que definira a cor? Desculpe se estou sendo chata, mas acho que deveria ter reuniões entre os formandos e que todos tivessem alguma decisão.<br>Obrigada <br><br><br>Respondendo a: <br>Resp: Reunião com os formandos', '1024592802696', '1026319232417'),
('1026319467160', '', 'Reunião com os formandos', '1019700068942', 'Gostaria de saber se as reuniões citadas no graw são só para os participantes da comissão ou se haverá alguma reunião para os outros formandos Gostaria de saber também se todos os formandos podem participar nas horas de decisão ou se só é a comissão de formatura que decide as coisas, tipo baile, missa. rifas, etc<br>Obrigada', '1024592802696', '1026319232417'),
('1026352254445', '1020387926088', 'Resp: Java e aplicações comerciais Stand Alone', '1018517966065', 'O que são aplicações Stand Alone!?', '1019521412057', '1020387870333'),
('1026393814529', '1026319467160', 'Resp: Reunião com os formandos', '1024519872238', 'As reuniões semanais são pra comissão se encontrar(manhã/tarde) e fazer avaliações sobre o que foi feito durante a semana e planejar as atividades da próxima semana. Não temos tido problema algum com outros formandos acompanhando as reuniões como observadores que são bem-vindos.<br><br>A escolha dos itens da formatura como os locais dos eventos, por exemplo, É feita pela comissão e depois repassada através do Graw se houver algum tipo de descontentamento quanto as decisões o forum é a ferramenta ideal para gerar a discussão e se for uma opinião da maioria A comissão terá de rever sua decisão. O formando tb pode conversar com qualquer membro da comissão normalmente na UFAL.', '1024592802696', '1026319232417'),
('1021058623939', '', 'Alimentação, movimentação, respiração e pensamento.', '1021056706145', 'São os quatro pontos cardeais para transformação do indivíduo. ', '1019939868602', '1021058089792'),
('1026269349606', '1026232027895', 'Resp: Que bicho é esse?', '1017145015032', 'bem, acho que a matéria é bem interessante, e nos faz pensar se tudo o que muitas vezes vimos em filmes como \'Inteligência Artificial\', robôs pensando e agindo como seres humanos, estaria realmente longe de uma futura realidade.<br>De um lado encontram-se os que afirmam que isso é perfeitamente possível, como Kurzweil; do outro estão aqueles que acham que isso não passa de uma ilusão, e aí podemos incluir Lanier.<br>Será que poderíamos especular qual das duas correntes de pensamento estaria correta, se não temos ainda uma compreensão completa do que é o ser humano, tanto no sentido psicológico quanto no biológico ?<br>Acho que não.<br>Podemos portanto, tomar como base, a teoria filosófica de que o homem é feito de razão e emoção, e em cima dela fazer algumas previsões a respeito da viabilidade de pelo menos parte de tudo aquilo que vêem sendo proposto.<br>Por exemplo, será que teremos máquinas superinteligentes, que sejam capazes de nos tornar obsoletos ?<br>Acho que sim, pelo menos no meu ponto de vista. Basta que para isso partamos da definição de razão : \'Faculdade intelectual que permite ao homem formular conceitos ou princípios universais, através das idéias do raciocínio e do juízo.\', que é justamente o que se vem realizando com alguns sistemas de computação. O tempo trará ao homem o conhecimento necessário para tornar isso realidade, e tomara que traga também bom senso, para que se possa evitar a desgraça antes mesmo que ela aconteça.', '1016044335989', '1026231399030'),
('1026232027895', '', 'Que bicho é esse?', '1024938674289', 'Pessoal, acho que com este início de curso já dar para discutirmos sobre a IA, expressar opiniões etc... Assim:<br>   - O que voces estão achando dessa nova área de estudo?<br>   - Já descobiram tudo que a IA já fez e pode fazer? Onde voces acham que vamos chegar?<br>   - O que voces acharam da matéria da Super Iteressante?<br>   - Gostaram das idéias de Ray Kurzweil :), das reações e opniões de Bill Joy, Jaron Lanier e outros...<br><br>Falem a vontade e discutam bastante!<br><br>[]´s<br>  Aydano<br>   <br>', '1016044335989', '1026231399030'),
('1026178089620', '1026163305691', 'Resp: redução de custos / levantamento de fundos', '1015331789194', 'Como assim um seminário de informática ???<br>Além disso qual o orçamento inicial incluindo todas as despesas ?', '1024592802696', '1026163065926'),
('1024409914130', '', 'Desenvolvimento de Jogos', '1018362443321', 'Uma página muito interessante com diversos tópicos sobre programação voltada para a área de jogos.<br><br>www.gamedev.net', '1019503684356', '1019522197038'),
('1024934932230', '', 'LAN Party - Onde e Quando?', '1019139944399', 'Aí galera... coloquem aqui as opiniões de vocês sobre onde e quando deve ser a festa, vamos discutir aqui para chegarmos a um lugar e um dia melhor para todos.', '1019742207241', '1024934816818'),
('1025179598638', '', 'Linguagem  Assembly', '1018878153623', 'Para cada arquitetura de computadores há uma linguagem assembly, ou para cada processador há uma linguagem assembly diferente ?', '1015439199628', '1019929104096'),
('1025179808859', '', 'Linguagem Assembly', '1018878153623', 'Para cada arquitetura de computadores há uma linguagem assembly, ou para cada processador há uma linguagem assembly diferente ?', '1015439199628', '1025179698958'),
('1026163305691', '', 'redução de custos / levantamento de fundos', '1024519872238', 'Este forum sera utilizado para trocarmos idéias de como:<br>  - economizar nos gastos<br>  - lenvantar fundos alternativos.<br>Questão número um:<br>  Uma festa é viável? Quem estaria disponivél a ajudar \'relamente\'?<br>Questão número dois:<br>  Um seminário de informática é viável?  Quem estaria disponivél a ajudar \'relamente\'?', '1024592802696', '1026163065926'),
('1026173476828', '1026163305691', 'Resp: redução de custos / levantamento de fundos', '1019087441845', 'acho que seria bem adequado uma definição de como ajudar \'realmente\' pra ficar mais claro.. a festa é uma coisa que se deve discutir porque pode ser q cada um fazendo a sua festa com seus familiares e amigos seja mais pratico.. e mais razoável..', '1024592802696', '1026163065926'),
('1025205903286', '', 'Configurando Server-Linux', '1025203222825', 'Quias os parametros necessários para configuração de uma rede Linux como servidor e (R)Windows 9X ou superior como Front-end, para confirmação e manipulação de dados pelo usuário final?', '1019795057341', '1020224335081');
